import React from 'react';
import { Link } from 'react-router-dom';
import { AppBar, Toolbar, Button } from '@mui/material';
import flowerImage from '../images/flower.jpg';
import '../styles/Navbar.css'; // Import the CSS file

const Navbar = () => {
  return (
    <AppBar position="static" className="navbar">
      <Toolbar className="navbar-toolbar">
        {/* Wrap the logo with Link to make it clickable */}
        <Link to="/">
          <img
            src={logo}
            alt="Logo"
            className="navbar-logo"
          />
        </Link>
        {/* Right-aligned navbar buttons */}
        <div className="navbar-buttons-container">
          <Button color="inherit" component={Link} to="/" className="navbar-buttons">
            Home
          </Button>
          <Button color="inherit" component={Link} to="/services" className="navbar-buttons">
            Services
          </Button>
          <Button color="inherit" component={Link} to="/contact" className="navbar-buttons">
            Contact Us
          </Button>
          <Button color="inherit" component={Link} to="/location" className="navbar-buttons">
            Location
          </Button>
        </div>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
